import React from 'react';

function RankingListItem(props) {

    return (
        <div className="RankingListItem">
            <div><div className="RankingListItemText">{props.listIndex}</div></div>
            <div><div className="RankingListItemText">{props.streamerName}</div></div>
            <div><div className="RankingListItemText">{props.accountName}</div></div>
            <div><div className="RankingListItemText">{props.rankName}</div></div>
            <div><div className="RankingListItemText">{props.ladderRank}</div></div>
            <div><div className="RankingListItemText">{props.totalWins}</div></div>
            <div><div className="RankingListItemText">{props.totalLosses}</div></div>
        </div>
    );
}

export default RankingListItem;
